  const dropdownItem = props.genreList.map((genre) =>
  <NavbarDropdownItem id={genre.id} name={genre.name} /> );
  console.log('dropdownitem', dropdownItem);
  return (
    <>
      <NavDropdown title="Browse" id="collasible-nav-dropdown" className="mx-1">
        <NavbarDropdownItem />
      </NavDropdown>
    </>
  );
}
